def poly_type(x):
    x = int(x)
    if x > 5 or x < 0:
        raise argparse.ArgumentTypeError("poly ∈ [0, 5]")
    return x

parser = argparse.ArgumentParser(
        usage='\n  %(prog)s --poly № < in_file.json > out_file.json\n  %(prog)s --help',
        formatter_class=argparse.RawTextHelpFormatter)
poly = parser.add_mutually_exclusive_group(required=True)
poly.add_argument('-p', '--poly', type=poly_type, help="""0 -> mean  f(x) = a;
1 -> poly1 f(x) = a+bx;
2 -> poly2 f(x) = a+bx+cx²;
3 -> poly3 f(x) = a+bx+cx²+cx³
4 -> poly4 f(x) = a+bx+cx²+dx³+ex⁴
5 -> poly5 f(x) = a+bx+cx²+dx³+ex⁴+fx⁵
""")
parsed_args = parser.parse_args()

sums = json.load(sys.stdin)

ncaps = 0
for b_n, board in sums.items():
    for channel in board:
        ncaps += len(channel)
progress_bar = tqdm.tqdm(desc='Cap', total=ncaps)

caldat = {}
for b_n, board in sums.items():
    caldat[b_n] = list()
    for channel in board:
        ll = list()
        for cap in channel:
            capsums = dict(
                    n = cap['n'],
                    S_x = cap['t'],
                    S_x2 = cap['t2'],
                    S_x3 = cap['t3'],
                    S_x4 = cap['t4'],
                    S_x5 = cap['t5'],
                    S_x6 = cap['t6'],
                    S_x7 = cap['t7'],
                    S_x8 = cap['t8'],
                    S_x9 = cap['t9'],
                    S_x10 = cap['t10'],
                    S_y = cap['Ct'],
                    S_xy = cap['tCt'],
                    S_x2y = cap['t2Ct'],
                    S_x3y = cap['t3Ct'],
                    S_x4y = cap['t4Ct'],
                    S_x5y = cap['t5Ct'],
                    )
            try:
                if parsed_args.poly == 0:
                    res = lin_reg0(**capsums)
                    ll.append([*res, 0, 0, 0, 0, 0])
                if parsed_args.poly == 1:
                    res = lin_reg1(**capsums)
                    ll.append([*res, 0, 0, 0, 0])
                if parsed_args.poly == 2:
                    res = lin_reg2(**capsums)
                    ll.append([*res, 0, 0, 0])
                if parsed_args.poly == 3:
                    res = lin_reg3(**capsums)
                    ll.append([*res, 0, 0])
                if parsed_args.poly == 4:
                    res = lin_reg4(**capsums)
                    ll.append([*res, 0])
                if parsed_args.poly == 5:
                    res = lin_reg5(**capsums)
                    ll.append(res)
            except ZeroDivisionError:
                ll.append([0, 0, 0, 0, 0, 0])
            progress_bar.update()
        biaslist = next(zip(*ll))
        bias = np.average(biaslist)
        for l in ll:
            l[0] -= bias
        caldat[b_n].append(ll)

res = pprint.pformat(caldat, width=150).replace("'", '"')
print(res)
